import React from "react";

const estados = [
  {
    id: 1,
    estado: "pendiente",
  },
  {
    id: 2,
    estado: "entregado",
  },
];
export default function Estado() {
  return (
    <div>
      {estados.map((estado) => {
        return (
          <option>
            {estado.estado} key={estado.id}
          </option>
        );
      })}
    </div>
  );
}
